import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-container">

        {/* Left: Description */}
        <div className="footer-section">
          <h2 className="footer-logo">Panchkarma</h2>
          <p className="footer-description">
            Embrace natural healing through Ayurvedic wisdom. Your journey to balance and wellness begins here.
          </p>
        </div>

        {/* Middle: Navigation */}
        <div className="footer-links">
          <h3 className="footer-title">Quick Links</h3>
          <ul className="footer-link-list">
            <li><Link to="/" className="footer-link">Home</Link></li>
            <li><Link to="/about" className="footer-link">About</Link></li>
            <li><Link to="/profile" className="footer-link">My Account</Link></li>
          </ul>
        </div>

        {/* Right: Contact */}
        <div className="footer-contact">
          <h3 className="footer-title">Contact Us</h3>
          <p>Email:
            <a href="mailto:nakrniabhishek128@gmail.com" className="footer-contact-link">
              nakrniabhishek128@gmail.com
            </a>
          </p>
          <p>Phone:
            <a href="tel:+919879843758" className="footer-contact-link">
              +91 98798 43758
            </a>
          </p>
        </div>
      </div>

      {/* Bottom Line */}
      <div className="footer-bottom">
        Â© {new Date().getFullYear()} Panchkarma. All rights reserved. | Terms & Conditions apply.
      </div>
    </footer>
  );
};

export default Footer;
